How It's Made Collection 1

Technology Documentary hosted by Mark Tewksbury and June Wallack and Tony Hirst, published by Discovery Channel in 2007 - English narration


Information
------------------------------

How It's Made Collection 1
Each day we use hundreds of products throughout our routines, never stopping to think about where those products come from and how they were manufactured. How It's Made shows you the outrageous behind the ordinary in the step-by-step processes of building, crafting and creating our most common products. From hearing aids to holograms, snowboards to solar panels and false teeth to fireworks, you'll learn the practice behind the procedure of producing 200 of your favourite things!


1)  Disc One 
Part 1 aluminum foil, snowboards, contact lenses and bread
Part 2 compact discs, mozzarella cheese, pantyhose and fluorescent tubes
Part 3 toothpicks, acrylic bathtubs, helicopters and beer
Part 4 hearing aids, 3-D puzzles, rubber mats and toilets
Part 5 copy paper, jeans, computers and plate glass
Part 6 nails and staples, safety glasses, fabrics and bicycles
Part 7 kayaks, safety boots, electronic signs and cereals
Part 8 trucks, adhesive bandages, computer circuit boards and liquors
Part 9 steel, apple juice, aircraft landing gear and cosmetics

2)  Disc Two 
Part 10 holograms, package printing, skin cultures and canned corn
Part 11 plastic bags, solar panels, plastic gasoline containers and hockey sticks
Part 12 aluminum screw caps, chocolate, pills and pasta
Part 13 bicycle helmets, lithium batteries, car brakes and aluminum
Part 14 goat silk, eyeglass lenses, granite, potato chips and microprocessors
Part 15 honey, fibre-optics, bricks and pipe organs
Part 16 personal watercraft, wine, office furniture and ice skates
Part 17 winter jackets, animation, mushrooms and gold rings
Part 18 hydroponic lettuce, construction wood, recycling and fishing flies

3)  Disc Three 
Part 19 diamond cuttings, wood doors, paintballs and newspapers
Part 20 carpets, drinking water, laser eye surgery and acoustic guitars
Part 21 fiberglass boats, clothes dryers, bubble gum and fireworks
Part 22 steel safes, false teeth, airplanes and maple syrup
Part 23 gummies, aluminum cans, fish farming and bronze sculptures
Part 24 aluminum pots pans, artificial limbs, peanut butter &amp; high-intensity light bulbs
Part 25 cars, grocery carts, rapid tooling and prototyping and collectible coins
Part 26 ball bearings, electrical wires, wax process casting and automated machines

